import React, { Component } from 'react';
import merosie from './images/merosie.jpg';


class About extends Component{
	render(){
		return(

		<div>
			<img src={merosie} style={{width: 400}} alt='Diana and Rosie' />
		</div>
		);
	}
}

export default About;
